class jdLogs {
    constructor(params) {
        this.set(params)
    }

    set(params = {}) {
        for (let i in params) {
            this[i] = params[i];
        }
    }

    async init(params = {}) {
        this.set(params)
    }

    async body(params) {
        let log = logs.sort(function() {
            return Math.random()>0.5 ? -1 : 1;
        });
        let ss = {...{sceneid: this.sceneid}, ...log[0]}
        switch (this.type) {
            case 0:
                delete ss.sceneid
                return ss
                break
            case 1:
                let a = {
                    "extraData": {
                        "log": ss.log,
                        "sceneid": ss.sceneid
                    },
                    "random": ss.random
                }
                return {...a, ...params}
                break
            case 2:
                let b = {
                    "extParam": {
                        "forceBot": "1",
                        "businessData": {"random": ss.random},
                        "signStr": ss.log,
                        "sceneid": ss.sceneid
                    },
                }
                return {...b, ...params}
                break
            default:
                return ss;
                break
        }
    }
}

module.exports = jdLogs;
